import React, { useState } from "react";
import "../App.css";
import { NavLink } from "react-router-dom";
import Side_component from "./Auth_components";

const Signup = () => {
    const [user, setUser] = useState({
        Name: "", Phone: "", Age: "", Gender: "", Email: "", UserID: "", Password: "", CPassword: ""
    });

    const [check_all, setCheck_all] = useState(false)

    let name, value
    const handleInputs = (e) => {
        e.preventDefault();
        console.log(e);
        name = e.target.name;
        value = e.target.value;
        setUser({ ...user, [name]: value });
    };

    function check() {
        setCheck_all(!check_all);
        console.log(check_all)
        if (user.Password != user.CPassword) {
            setCheck_all(false)
        }
    };

    const PostDATA = async (e) => {

        e.preventDefault();
        const { Name, Phone, Age, Gender, Email, UserID, Password, CPassword } = user
        const res = await fetch("/register", {
            method: "POST",
            body: JSON.stringify({ Name: Name, Phone: Phone, Age: Age, Gender: Gender, Email: Email, UserID: UserID, Password: Password, CPassword: CPassword }),
            headers: {
                "Content-Type": "application/json"
            },
        })
        const result = await res.json()
        console.log(result)
        if (res.ok) {
            window.alert("Successful registration")
            console.log("Successful registration")
        }
        else {
            // window.alert("invalid registration")
            alert();
            console.log("invalid registration")
        }

    }

    function alert(){
        <div class="alert alert-danger" role="alert">
            Wrong
        </div>
    }

    return (
        <div>
            <img src={"./images/food2.jpeg"} id="base_image_auth" />
            <div className="main_container">
                <Side_component />
                <section className="auth_section_container">
                    <div className="navbar_signin_or_signup">
                        <p>
                            Already a member?{" "}
                            <NavLink to="/signin" id="Signup_Sigin_navigate">
                                Signin
                            </NavLink>
                        </p>
                    </div>
                    <main className="auth_data_section">
                        <div className="auth_content_signup">
                            <div className="inside_container_signup">
                                <h5 className="banner">Sign in to art.of.flavours</h5>
                                <br />
                                <div className="google_signin">
                                    {/* <div id="my-signin2"></div> */}
                                </div>
                                <br />
                                <hr className="divider" />
                                <div className="form_field">
                                    <form method="POST" className="form-look">
                                        <div className="form-group-signup">
                                            <label htmlFor="name">
                                                <h6>Name</h6>
                                            </label>
                                            <input type="text" className="form-control" id="Name" aria-describedby="emailHelp" placeholder="Full Name" name="Name" value={user.Name} onChange={handleInputs} required />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="phone">
                                                <h6>Phone</h6>
                                            </label>
                                            <input type="number" className="form-control" id="Phone" aria-describedby="emailHelp" placeholder="+91" name="Phone" value={user.Phone} maxlength="10" onChange={handleInputs} required />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="age">
                                                <h6>Age</h6>
                                            </label>
                                            <input type="number" className="form-control" id="Age" aria-describedby="emailHelp" placeholder="" min="1" max="100" name="Age" value={user.Age} onChange={handleInputs} required />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="gender">
                                                <h6>Gender</h6>
                                            </label>
                                            <input type="text" className="form-control" id="Gender" aria-describedby="emailHelp" placeholder="" name="Gender" value={user.Gender} onChange={handleInputs} required />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="email">
                                                <h6>Email address</h6>
                                            </label>
                                            <input type="email" className="form-control" id="Email" aria-describedby="emailHelp" placeholder="" name="Email" value={user.Email} onChange={handleInputs} required
                                            />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="uid">
                                                <h6>User ID</h6>
                                            </label>
                                            <input type="text" className="form-control" id="uid" aria-describedby="emailHelp" placeholder="" name="UserID" value={user.UserID} onChange={handleInputs} required
                                            />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="password">
                                                <h6>Password</h6>
                                            </label>
                                            <input type="password" className="form-control" id="Password" placeholder="Password" name="Password" value={user.Password} onChange={handleInputs} required
                                            />
                                        </div>
                                        <div className="form-group-signup">
                                            <label htmlFor="c_password">
                                                <h6>Confirm Password</h6>
                                            </label>
                                            <input type="password" className="form-control" id="C_Password" placeholder="Password" name="CPassword" value={user.CPassword} onChange={handleInputs} required />
                                        </div>
                                        <div className="check-box-signup">
                                            <div id="check-box">
                                                <input type="checkbox" onClick={check} />
                                            </div>
                                            <label className="form-check-label" for="exampleCheck1" >
                                                <h6>Confirm</h6>
                                            </label>
                                        </div>
                                        <button type="submit" className="btn btn-primary submit_button_signup" disabled={check_all === false} onClick={PostDATA} >
                                            Signup
                                        </button>
                                    </form>
                                </div>
                            </div>
                        </div>
                    </main>
                </section>
            </div>
        </div>
    );
};

export default Signup;
